import time

import requests
import re
import os
from concurrent.futures import ThreadPoolExecutor,wait
from bs4 import BeautifulSoup

os.chdir("F://Wallpaper/")

headers = {
    'user-agent':'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/103.0.0.0 Safari/537.36',
}


html_urls = []

find_html = re.compile('<a class="preview" href="(.*?)"  target="_blank"  ></a>',re.S)
find_pic = re.compile('<img alt=".*?" data-wallpaper-height="(.*?)" data-wallpaper-id="(.*?)" data-wallpaper-width="(.*?)" id="wallpaper" src="(.*?)"/></div>',re.S)
string = '<img id="wallpaper" src="https://w.wallhaven.cc/full/v9/wallhaven-v9kw9l.jpg" alt="General 3840x2766 F F CGI women League of Legends hat portrait Caitlyn (League of Legends) steampunk steampunk girl top hat long hair cityscape digital art" data-wallpaper-id="v9kw9l" data-wallpaper-width="3840" data-wallpaper-height="2766" crossorigin="anonymous" class="fill-vertical">'

class Wallpaper:
    def __init__(self,url='', id='', width=0, height=0):
        self.url = url
        self.id = id
        self.width = width
        self.height = height


def get_html_url(page:int,max_try:int):
    if max_try < 5:
        url_top_list = f"https://wallhaven.cc/toplist?page={page+1}"
        req = requests.get(url_top_list,headers=headers)
        if req.status_code == 200:
            response = req.content.decode()
            for url in re.findall(find_html,response):
                html_urls.append(url)
        else:
            max_try += 1
            get_html_url(page,max_try)

def get_pic_url(url:str,max_try:int):
    req = requests.get(url, headers = headers)
    if max_try<5:
        if req.status_code == 200:
            response = req.content.decode()
            soup = BeautifulSoup(response,'html.parser')
            showcase = soup.select("#showcase")[0]
            tup = re.findall(find_pic,str(showcase))[0]
            wallpaper = Wallpaper(tup[3],tup[1],int(tup[2]),int(tup[0]))
            download(wallpaper,0)
        else:
            time.sleep(10)
            max_try+=1
            get_pic_url(url,max_try)

def download(wallpaper:Wallpaper,max_try:int):
    if max_try < 5:
        req = requests.get(wallpaper.url,headers=headers)
        if req.status_code == 200:
            response = req.content
            type = wallpaper.url[wallpaper.url.index('.', -6, -1) + 1:]
            dirs = os.listdir()
            if f"{wallpaper.width}x{wallpaper.height}_{wallpaper.id}.{type}" not in dirs:
                with open(f"./{wallpaper.width}x{wallpaper.height}_{wallpaper.id}.{type}","wb") as f:
                    f.write(response)
                print(f'{wallpaper.width}x{wallpaper.height}_{wallpaper.id}.{type} 下载完毕.')
        else:
            time.sleep(10)
            max_try+=1
            download(wallpaper,max_try)

